import * as Icon from '../components/icon'
import React from 'react'

export default {
    MOBILE_SIZE: 700,
    TABLET_SIZE: 925,
}
export const MENU = [
    {
        key: 'twitter',
        icon: <Icon.Twitter style={{ fontSize: 30 }} />,
        iconSelected: <Icon.Twitter />,
        title: '',
    },
    {
        key: 'home',
        icon: <Icon.Home />,
        iconSelected: <Icon.HomeFill />,
        title: 'Home',
    },
    {
        key: 'explore',
        icon: <Icon.Basket />,
        iconSelected: <Icon.BasketFill />,
        title: 'Explore',
    },
    {
        key: 'notification',
        icon: <Icon.Notification />,
        iconSelected: <Icon.NotificationFill />,
        title: 'Notification',
    },
    {
        key: 'messages',
        icon: <Icon.Profile />,
        iconSelected: <Icon.ProfileFill />,
        title: 'Messages',
    },
    {
        key: 'bookmark',
        icon: <Icon.SettingsFill />,
        iconSelected: <Icon.Settings />,
        title: 'Bookmark',
    },
]
